import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

const actions ={}

const mutations={}

const state={
    user:{
        name:'万叶',
        passWord:'WY20030125'
    }
}

const store = new Vuex.Store({
    actions,
    mutations,
    state
})


export default store
